(3, 'A', 1, 5, '20A100', 'Appartement T4 de 84.34 m² - GAP', "Secteur Gap sud, nous vous proposons à la vente ce bel appartement traversant type 4 de 84 m² au deuxième étage d'une résidence avec ascenseur. Ce logement rénové récement dispose d'un séjour lumineux, de trois chambres et d'une salle de bain. Vous profiterez également d'une cave et d'un garage. À visiter rapidement !", 'GAP', 84, 84, 175000, 'C', '2020-11-13', NULL),
(4, 'A', 3, NULL, '20A100', 'Terrain de 10000 m² - JARJAYES', "Sur la commune de JARJAYES, à 20 minutes de Gap, nous vous proposons à la vente ce terrain de 10 000 m² entièrement constructible. La parcelle offre une très belle exposition ainsi qu'une superbe vue sur les sommets environnants.", 'JARJAYES', 0, 10000, 420000, 'V', '2020-11-13', NULL),
(5, 'A', 1, 5, '20A100', '100 km de Paris, maison 85m2 avec jardin', "Exclusivité : dans bourg tous commerces avec écoles, maison d\'environ 85m2 habitables, mitoyenne, offrant en rez-de-chaussée, une cuisine aménagée, un salon-séjour, un WC et une loggia et à l\'étage, 3 chambres dont 2 avec placard, salle de bains et WC séparé. 2 garages. Le tout sur une parcelle de 225m2. Chauffage individuel clim réversible, DPE : F. ", 'Somme (80), 1h00 de Paris', 85, 225, 197000, 'F', '2020-11-13', NULL),
